import numpy as np

class AddrEnc:
    # Consider the address size is 56 bits
    def encrypt(self, address, key): 
        # change address to binary string
        address = bin(int(address, 16))[2:].zfill(56)

        addressL = np.array([int(address[i]) for i in range(0, 28)])
        addressR = np.array([int(address[i]) for i in range(28, 56)])
        key = np.array([int(key[i]) for i in range(0, 112)])
        # Stage 1
        addressL_1 = addressR
        addressR_1 = np.bitwise_xor(addressL, self.F(1, addressR, key[0:28]))
        # Stage 2
        addressL_2 = addressR_1
        addressR_2 = np.bitwise_xor(addressL_1, self.F(2, addressR_1, key[28:56]))
        # Stage 3
        addressL_3 = addressR_2
        addressR_3 = np.bitwise_xor(addressL_2, self.F(3, addressR_2, key[56:84]))
        # Stage 4
        addressL_4 = addressR_3
        addressR_4 = np.bitwise_xor(addressL_3, self.F(4, addressR_3, key[84:112]))

        # convert address back to hex string
        addr_bstr = ''.join(map(str, np.append(addressL_4, addressR_4)))
        addr_hstr = hex(int(addr_bstr, 2))
        return addr_hstr

        

    def decrypt(self, address, key):
        # change address to binary string
        address = bin(int(address, 16))[2:].zfill(56)

        addressL_4 = np.array([int(address[i]) for i in range(0, 28)])
        addressR_4 = np.array([int(address[i]) for i in range(28, 56)])
        key = np.array([int(key[i]) for i in range(0, 112)])
        # Stage 1
        addressR_3 = addressL_4
        addressL_3 = np.bitwise_xor(addressR_4, self.F(4, addressL_4, key[84:112]))
        # Stage 2
        addressR_2 = addressL_3
        addressL_2 = np.bitwise_xor(addressR_3, self.F(3, addressL_3, key[56:84]))
        # Stage 3
        addressR_1 = addressL_2
        addressL_1 = np.bitwise_xor(addressR_2, self.F(2, addressL_2, key[28:56]))
        # Stage 4
        addressR = addressL_1
        addressL = np.bitwise_xor(addressR_1, self.F(1, addressL_1, key[0:28]))

        # convert address back to hex string
        addr_bstr = ''.join(map(str, np.append(addressL, addressR)))
        addr_hstr = hex(int(addr_bstr, 2))
        return addr_hstr

    def op_sbox(self, sbox, input):
        return np.array([np.bitwise_xor.reduce(np.bitwise_and(input, sbox[i])) for i in range(0, 28)])

    def op_pbox(self, pbox, input):
        return np.matmul(input, pbox)
    
    def F(self, it, addressL, key):
        if it == 1:
            return self.op_pbox(self.pbox1, self.op_sbox(self.sbox1, np.append(addressL, key)))
        elif it == 2:
            return self.op_pbox(self.pbox2, self.op_sbox(self.sbox2, np.append(addressL, key)))
        elif it == 3:
            return self.op_pbox(self.pbox3, self.op_sbox(self.sbox3, np.append(addressL, key)))
        else:
            return self.op_pbox(self.pbox4, self.op_sbox(self.sbox4, np.append(addressL, key)))

